import logo from './logo.svg';
import './App.css';
import GoalList from './Components/GoalList';
import NewGoal from './Components/NewGoal';

const App =()=>{
  const CourseGoals=[
    {id:'cg1',text:'This is'},
    {id:'c02',text:'This is2'},
    {id:'c03',text:'This is3'}
  ]

  return (
    <>
      <GoalList goals={CourseGoals}/>
      <NewGoal/>
    </>
  );
}

export default App;
